UML:TaggedValue.value:
A Borehole SHALL have the following properties:
exactly one 'referenceLocation' that is specified by an OriginPosition feature;
one or more 'downholeDrillingDetails' that is specified by a DrillingDetails entity;
one or more 'logElement' that is specified by a MappedIntervale feature;
one or more 'indexData' that is specified by a BoreholeDetails entity.
Informative:
The referenceLocation is a geospatially located 3-D point that is the origin of the boring that created the hole, and is the origin of a linear spatial reference system defined along the trace of the borehole.

A LinearOrientationProperties  instance is a kind of GeometricDescriptionValue, and SHALL inherit the properties from that class;
At least one of plunge or trend SHALL have a value that is not nil.

A LinearOrientationProperties instance MAY have additional properties for plunge and trend  that are numeric range value, and a directed property that is a code value indicating whether the orientation has a distinct polarity.

An AlterationDescription SHALL have the following properties:
One  'alterationType' values specified by a term that classifies the kind of alteration;
One 'alterationDegree' value specified by a Category entity;
One 'alterationDistribution' value specified by a Category entity;
Informative:
All 'alterationDegree', and 'alterationDistribution' are voidable and are estimated properties.

An alterationDescription SHALL have one or more 'alterationProduct' values specified by an EarthMaterial entity;

Note:
The  'alterationProduct' property is  voidable and estimated

A MetamorphicDescription SHALL have the following properties:
One or more metamorphicFacies values specified by Category entities;
One 'metamorphicGrade' value specified by a Category entity;
One 'peakPressureValue' value specified by a Quantity entity;
One 'peakTemperatureValue' value specified by a Quantity entity;

A non-nil value SHALL be present for either 'metamorphicFacies' or 'metamorphicGrade'
Informative:
All properties are voidable and are estimated properties.
